import React, {Fragment, useState} from 'react';

import styles from './FooterContact.module.css';

function FooterContact() {

    const [visibility, handleVisibility] = useState(true)


    return (
        <Fragment>
            <footer className={`${visibility === true ? styles.footer :'hide'} `}
                    style={{justifyContent: 'center'}}>


                <div className={`${visibility===true? 'fs-300' : 'hide'}`}>
                    Email: <a href="mailto:alora@beebettermassage.com">alora@beebettermassage.com</a>
                </div>

                <div className={`${visibility===true? 'fs-300' : 'hide'}`}>
                    Phone: 385-313-0591
                </div>
                <div className={`${visibility===true? 'fs-300' : 'hide'}`}>
                    <a href="https://www.instagram.com/bee.better.massage">Instagram </a>
                </div>


            </footer>
        </Fragment>
    )
}

export default FooterContact;
